,p_display_name=>'APEX Pretius Translate Datepicker'
,p_category=>'COMPONENT'
,p_supported_ui_types=>'DESKTOP'
,p_plsql_code=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'function render_item (',
'  p_item                in apex_plugin.t_page_item,',
'  p_plugin              in apex_plugin.t_plugin,',
'  p_value               in varchar2,',
'  p_is_readonly         in boolean,',
'  p_is_printer_friendly in boolean )',
'  return apex_plugin.t_page_item_render_result ',
' AS  ',
'',
'  v_result apex_plugin.t_page_item_render_result; ',
'  v_page_item_name varchar2(100);',
'',
'  v_jquery_library_path varchar2(2000):= ''libraries/apex/minified/''; --Review this at APEX > 4.1',
'                                    --    libraries/jquery-ui/1.8.14/ui/i18n/oracle/ --4.1',
'  --Plugin attributes:',
'  v_calendar           p_item.attribute_06%type := p_item.attribute_06;',
'  v_locale             p_item.attribute_01%type := p_item.attribute_01;',
'  v_date_format        p_item.attribute_03%type := nvl(p_item.attribute_03, ''dd/mm/YYYY'');',
'  -- v_date_default_value p_item.attribute_04%type := apex_plugin_util.get_plsql_expression_result (p_plsql_expression => nvl(p_item.attribute_04, to_char(sysdate, v_date_format)));',
'  v_date_default_value p_item.attribute_04%type := p_item.attribute_04;--:= CASE p_item.attribute_04 WHEN NULL THEN NULL ELSE apex_plugin_util.get_plsql_expression_result (p_plsql_expression => nvl(p_item.attribute_04, to_char(sysdate, v_date_format)'
||')) END;',
'  v_local_numbers      p_item.attribute_05%type := CASE p_item.attribute_05 WHEN ''N'' THEN ''false'' WHEN ''Y'' THEN ''true'' END;',
'  v_show_mode          p_item.attribute_02%type := p_item.attribute_02;',
'  v_number_of_months   p_item.attribute_08%type := nvl(p_item.attribute_08, 1);',
'  v_minimum_date       p_item.attribute_09%type := p_item.attribute_09;',
'  v_maximum_date       p_item.attribute_10%type := p_item.attribute_10;',
'  v_navigation_for     p_item.attribute_11%type := p_item.attribute_11;',
'',
'  v_display varchar2(4000);',
'  v_return varchar2(4000);',
'  type t_cur IS REF CURSOR;',
'  c1 t_cur;',
'',
'  v_html varchar2(9000);',
'  v_oracle_format p_item.format_mask%type; ',
'  v_js_format p_item.format_mask%type; ',
'  v_js_date_format  p_item.format_mask%type; ',
'  v_js_timestamp_format  p_item.format_mask%type; ',
'  v_app_id varchar2(100) := v(''APP_ID'');',
'  v_primary_language varchar2(100);',
'',
'  v_full_date_value date;',
'  v_full_date_string_value varchar2(200);',
'',
'  v_timestamp_value varchar2(100);',
'  v_full_timestamp varchar2(100);',
'  v_date_string_value varchar2(100);',
'  v_item_value varchar2(100);',
'  /************ INPUTS  ****************/',
'  v_input varchar2(1000);',
'  v_input_text varchar2(1000);',
'  v_input_div  varchar2(1000);',
'  /************ CONSTANTS **************/',
'  v_calendar_trigger_html varchar2(500) := ''<button type="button" class="ui-datepicker-trigger a-Button a-Button--calendar"><span class="a-Icon icon-calendar"></span><span class="u-VisuallyHidden">Popup Calendar: Standard calendar<span></span></span>'
||'</button>'';',
'',
'  /***** PLUGIN CONSTRUCTOR VARS *****/',
'  v_js_default_date varchar2(1000);',
'  v_js_select_default_date varchar2(10);',
'  v_js_show_on_focus varchar2(10);',
'  v_js_show_trigger varchar2(500);',
'  v_js_navigation_for_year varchar2(500);',
'  v_js_navigation_for_month varchar2(500);',
'',
'BEGIN',
'    ',
'    IF apex_application.g_debug THEN',
'      apex_plugin_util.debug_page_item (p_plugin                => p_plugin,',
'                                        p_page_item             => p_item,',
'                                        p_value                 => p_value,',
'                                        p_is_readonly           => p_is_readonly,',
'                                        p_is_printer_friendly   => p_is_printer_friendly);',
'    END IF;',
'',
'',
'    IF p_is_readonly OR p_is_printer_friendly THEN    ',
'      apex_plugin_util.print_hidden_if_readonly (p_item_name             => p_item.name,',
'                                                 p_value                 => p_value,',
'                                                 p_is_readonly           => p_is_readonly,',
'                                                 p_is_printer_friendly   => p_is_printer_friendly);',
'      apex_plugin_util.print_display_only (p_item_name          => p_item.NAME,',
'                                           p_display_value      => p_value,',
'                                           p_show_line_breaks   => FALSE,',
'                                           p_escape             => TRUE,',
'                                           p_attributes         => p_item.element_attributes);',
'    ELSE',
'',
'      /********* Retreiving parameters and attributes **********/',
'      v_page_item_name := apex_plugin.get_input_name_for_page_item (p_is_multi_value => FALSE);',
'',
'      --v_full_timestamp  := v_date_format||'' ''||v_timestamp_format;',
'',
'      --v_oracle_format := nvl(v_full_timestamp, sys_context(''userenv'',''nls_date_format''));',
'      --v_js_format := wwv_flow_utilities.get_javascript_date_format(p_format => v_oracle_format);',
'      --v_js_date_format := wwv_flow_utilities.get_javascript_date_format(p_format => v_date_format);',
'      --v_js_timestamp_format := wwv_flow_utilities.get_javascript_date_format(p_format => v_timestamp_format);',
'',
'      select application_primary_language ',
'        into v_primary_language',
'        from APEX_APPLICATIONS ',
'       where application_id = v_app_id;',
'    /**',
'        PLUGIN CONSTRUCTOR VARS INIT',
'    */',
'    /***********************************/',
'    IF v_date_default_value is null then',
'      v_js_default_date := ''null'';',
'      v_js_select_default_date := ''false'';',
'    ELSE',
'      v_js_default_date := ''"''||apex_plugin_util.get_plsql_expression_result (p_plsql_expression => nvl(p_item.attribute_04, to_char(sysdate, v_date_format)))||''"'';',
'      v_js_select_default_date := ''true'';',
'    END IF;',
'',
'',
'    /************** SHOW MODE ***************/',
'',
'    v_input_text :=''<input type="text"',
'                   id="''||p_item.name||''_DATE"',
'                   value="''||v_item_value||''"',
'                   autocomplete="off"',
'                   size="''||p_item.element_width||''" ''||p_item.element_attributes||''>'';',
'',
'    v_input_div := ''<div id="''||p_item.name||''_DATE"></div>'';',
'    v_input := v_input_text;',
'',
'    IF v_show_mode = ''on_icon_click'' THEN',
'      v_js_show_on_focus := ''false'';',
'      v_js_show_trigger := v_calendar_trigger_html;',
'    ELSIF v_show_mode = ''on_focus'' THEN',
'      v_js_show_on_focus := ''true'';',
'      v_js_show_trigger := ''false'';',
'    ELSIF v_show_mode = ''both'' THEN',
'      v_js_show_on_focus := ''true'';',
'      v_js_show_trigger := v_calendar_trigger_html;',
'    ELSIF v_show_mode = ''inline'' THEN',
'      v_js_show_on_focus := ''false'';',
'      v_js_show_trigger := ''false'';',
'      v_input := v_input_div;',
'    END IF;',
'    /************** SHOW MODE ***************/',
'    ',
'    /*************** NAVIGATION FOR *********/',
'     ',
'    IF v_navigation_for = ''none'' THEN',
'      v_js_navigation_for_year := ''false'';',
'      v_js_navigation_for_month := ''false'';',
'    ELSIF v_navigation_for = ''months'' THEN',
'      v_js_navigation_for_year := ''false'';',
'      v_js_navigation_for_month := ''true'';',
'    ELSIF v_navigation_for = ''years'' THEN',
'      v_js_navigation_for_year := ''true'';',
'      v_js_navigation_for_month := ''false'';',
'    ELSIF v_navigation_for = ''month_and_years'' THEN',
'      v_js_navigation_for_year := ''true'';',
'      v_js_navigation_for_month := ''true'';',
'    END IF;',
'    /* ********** Item rendering   ********* */',
'',
'    htp.p( ''<input type="hidden"',
'                      id="''||p_item.name||''"',
'                      name="''||v_page_item_name||''"',
'                      value="''||v_item_value||''">',
'',
'            ''|| v_input );',
'',
'    v_html := ''',
'        var item_name = "#''||p_item.name||''_DATE";',
'        var calendar_type = "''|| v_calendar ||''";',
'        var lang = "''|| v_locale ||''";',
'',
'        $.calendarsPicker.setDefaults({renderer: $.calendarsPicker.themeRollerRenderer});',
'',
'        var loadName = ( (calendar_type == "julian" || calendar_type == "gregorian" )? "" : calendar_type);',
'        $.localise("''|| p_plugin.file_prefix ||''apex_localized_calendar/jquery.calendars" + (loadName ? "." : "") + loadName, lang); ',
'',
'        var calendar = $.calendars.instance(calendar_type, lang);',
'',
'        $("#''||p_item.name||''_DATE").calendarsPicker({',
'          calendar: calendar, ',
'          localNumbers: ''|| v_local_numbers ||'', ',
'          dateFormat:"''|| v_date_format ||''", ',
'          pickerClass: ''''pretius-localized-calendar'''',',
'          defaultDate: ''||v_js_default_date||'',',
'          showOnFocus: ''|| v_js_show_on_focus ||'',',
'          selectDefaultDate: ''||v_js_select_default_date||'',',
'          onSelect: function(date){$("#''||p_item.name||''_DATE").trigger(''''change'''');},',
'          showAnim: ''''fadeIn'''',',
'          minDate: ''''''|| v_minimum_date ||'''''',',
'          maxDate: ''''''|| v_maximum_date ||'''''',',
'          changeMonth:  ''|| v_js_navigation_for_month ||'',',
'          changeYear: ''|| v_js_navigation_for_year ||'',',
'          showAnim: ''''fadeIn'''',',
'          showTrigger: ''''''|| v_js_show_trigger ||'''''',',
'          monthsToShow: ''|| v_number_of_months ||''',
'        });',
'    '';',
'',
'    v_html := v_html||',
'              ''$("#''||p_item.name||''_DATE").trigger(''''change'''');',
'               $("#''||p_item.name||''_DATE").bind(''''change'''',',
'                  function(){',
'                    $("#''||p_item.name||''").val($("#''||p_item.name||''_DATE").val());',
'                  }',
'               );',
'    ''; ',
'',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.plugin.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.all.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.picker.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.picker.ext.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.persian.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.islamic.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.taiwan.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.calendars.thai.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        --p_name       => ''jquery.calendars.picker-ar.js?v=1.2.3.4'',',
'        p_name       => ''jquery.calendars.picker-''|| v_locale ||''.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'    apex_javascript.add_library(',
'        p_name       => ''jquery.localisation.js?v=1.2.3.4'',',
'        p_directory  => p_plugin.file_prefix || ''apex_localized_calendar/'' ,',
'        p_version    => null',
'    );',
'',
'    apex_css.add_file (',
'        p_name => ''jquery.calendars.picker'',',
'        p_directory =>  p_plugin.file_prefix || ''apex_localized_calendar/'' ',
'    );',
'',
'    apex_javascript.add_onload_code (p_code => v_html);',
'    v_result.is_navigable := FALSE;',
'',
'    END IF; ',
'',
'    RETURN v_result;',
'end render_item;'))
,p_render_function=>'render_item'
